import{_ as i,a as l,o as a,H as t}from"./chunks/framework.Cao6T-Ti.js";const s="/assets/CMITPM180118DEN55ISLEO.DbuNBpcl.jpg",e="/assets/CMITPM180118DENISLE5O.DDl2nRGF.jpg",r="/assets/CMITPM180118DENISLEO.CXPSTC8g.jpg",o="/assets/1.atR2MNrs.jpg",n="/assets/3.Ih6N2zj4.jpg",p="/assets/5.Dej9LFkh.jpg",c="/assets/15.CbNWWZKR.jpg",h="/assets/33.C4gppywu.jpg",u="/assets/166.3u11399q.jpg",d="/assets/666.DipecfFZ.jpg",m="/assets/1515.C_Mc9uv3.jpg",j=JSON.parse('{"title":"Проектные мастерские","description":"ЦМИТ","frontmatter":{"title":"Проектные мастерские","description":"ЦМИТ","date":"2019-10-16","icon":"logo.png","cover":"cover.jpg","address":"Дербеневская улица, дом 20, Бизнес-парк «Кожевники»","place":"м. Павелецкая","city":"г. Москва","tel":"+7 (499) 550-24-23","email":"friends@promasterskie.com","url":"https://www.promasterskie.com","hours":"ежедневно с 10 до 22","status":"open","coord":[55.72160491876503,37.64781375416921],"youtube":"https://youtu.be/wNJ4j2oZhpQ"},"headers":[],"relativePath":"workshop/catalog/proektnye-masterskie/index.md","filePath":"workshop/catalog/proektnye-masterskie/index.md"}'),g={name:"workshop/catalog/proektnye-masterskie/index.md"},_=t('<h3 id="экспериментальныи-центр-созданныи-для-развития-дизаина-и-проектнои-культуры" tabindex="-1">Экспериментальный центр, созданный для развития дизайна и проектной культуры <a class="header-anchor" href="#экспериментальныи-центр-созданныи-для-развития-дизаина-и-проектнои-культуры" aria-label="Permalink to &quot;Экспериментальный центр, созданный для развития дизайна и проектной культуры&quot;">​</a></h3><p>Инфраструктура центра позволяет работать как в собственной студии, так и воспользоваться ресурсами профильного коворкинга: - швейной мастерской с профессиональным и бытовым оборудованием, - мастерской трехмерного моделирования и прототипирования, - конференц-залом и компьютерным классом.</p><p>Совершенствуя услуги и сервисы Проектных мастерских, мы создаем сообщество и развиваем индустрию дизайна в России.</p><p>«ПРОЕКТНЫЕ МАСТЕРСКИЕ» — абсолютно новый тип профессионального и обучающего пространства, его ключевая роль: развитие проектной культуры в сфере творческих индустрий. Создавая «Проектные мастерские» мы решили объединить в рамках одного рабочего пространства несколько целевых групп: студентов ВУЗов, молодых специалистов в сфере архитектуры и дизайна и учеников средней школы. На площади 500 квадратных метров расположились профильный коворкинг, проектные студии и аудитории для проведения лекций и семинаров.</p><p>«Проектные мастерские» дают возможность совместить теорию и практику, и применить полученные навыки на профессиональном оборудовании. Такой подход помогает добиться полного погружения в творческий процесс и сделать каждое занятие максимально эффективным. Мы предоставляем возможность получить консультации профильных лаборантов, работать с разными материалами и формами, используя ресурсы швейного цеха с профессиональным и бытовым оборудованием, принтеры и сканеры для 3D-моделирования и прототипирования, фрезерный станок и современные графические программы.</p><p><img src="'+s+'" alt=""><img src="'+e+'" alt=""><img src="'+r+'" alt=""></p><h2 id="услуги-и-сервисы" tabindex="-1">УСЛУГИ И СЕРВИСЫ <a class="header-anchor" href="#услуги-и-сервисы" aria-label="Permalink to &quot;УСЛУГИ И СЕРВИСЫ&quot;">​</a></h2><h3 id="для-малого-и-среднего-бизнеса" tabindex="-1">ДЛЯ МАЛОГО И СРЕДНЕГО БИЗНЕСА <a class="header-anchor" href="#для-малого-и-среднего-бизнеса" aria-label="Permalink to &quot;ДЛЯ МАЛОГО И СРЕДНЕГО БИЗНЕСА&quot;">​</a></h3><ul><li>абонемент для сотрудников компании в швейный цех от 700 рублей в день,</li><li>складское хранение тканей, лекал и рабочих материалов во время производственной сессии,</li><li>разработка, оцифровка, градация и распечатка лекал,</li><li>подбор профильных российских и зарубежных швейных фабрик,</li><li>подбор поставщиков тканей и фурнитуры,</li><li>аутсорсинг разработки сезонных коллекций,</li><li>консультация технолога и конструктора,</li><li>юридическое сопровождение марки или проектов,</li><li>аренда конференц-зала для проведения клиентских дней или профильных мероприятий,</li><li>индивидуальная разработка курса повышения квалификации для сотрудников компании.</li></ul><h4 id="для-дизаинеров" tabindex="-1">ДЛЯ ДИЗАЙНЕРОВ <a class="header-anchor" href="#для-дизаинеров" aria-label="Permalink to &quot;ДЛЯ ДИЗАЙНЕРОВ&quot;">​</a></h4><ul><li>абонемент в швейный коворкинг на срок от 1 дня,</li><li>консультация технолога и конструктора,</li><li>юридическое сопровождение марки или проектов,</li><li>разработка, оцифровка, градация и распечатка лекал,</li><li>проведение рабочих встреч и примерок,</li><li>каталог регулярных коллекций тканей от ведущих поставщиков и возможность</li><li>заказа купонов от 1 м. с доставкой в Проектные мастерские,</li><li>участие в программе лояльности и доступ к базе профильных партнеров центра.</li></ul><h4 id="для-детеи-и-подростков" tabindex="-1">ДЛЯ ДЕТЕЙ И ПОДРОСТКОВ <a class="header-anchor" href="#для-детеи-и-подростков" aria-label="Permalink to &quot;ДЛЯ ДЕТЕЙ И ПОДРОСТКОВ&quot;">​</a></h4><ul><li>участие в летней творческой школе «Хочу все знать!»,</li><li>организация экскурсий для небольших групп в лучшие музеи Москвы,</li><li>индивидуальная разработка выездного мастер-класса.</li></ul><h3 id="преимущества" tabindex="-1">ПРЕИМУЩЕСТВА <a class="header-anchor" href="#преимущества" aria-label="Permalink to &quot;ПРЕИМУЩЕСТВА&quot;">​</a></h3><p>Проектные мастерские – это ресурс, который позволяет вам эффективно развивать свой бизнес и значительно снизить расходы на запуск, содержание и обслуживание марки одежды.</p><h3 id="совершенствующиеся-сервисы" tabindex="-1">Совершенствующиеся сервисы <a class="header-anchor" href="#совершенствующиеся-сервисы" aria-label="Permalink to &quot;Совершенствующиеся сервисы&quot;">​</a></h3><ul><li>распечатка и оцифровка лекал,</li><li>каталоги регулярных коллекций тканей от компаний Tkani Buro и Tkani Pro,</li><li>современное программное обеспечение от наших партнеров САПР «Ассоль» и Auto desk,</li><li>портновские манекены Royal Dress Form.</li></ul><h5 id="абонементы-с-гибким-графиком" tabindex="-1">Абонементы с гибким графиком <a class="header-anchor" href="#абонементы-с-гибким-графиком" aria-label="Permalink to &quot;Абонементы с гибким графиком&quot;">​</a></h5><ul><li>стоимость дня от 650 рублей,</li><li>срок действия абонемента до 2-х месяцев,</li><li>подарочные абонементы.</li></ul><h3 id="локация" tabindex="-1">Локация <a class="header-anchor" href="#локация" aria-label="Permalink to &quot;Локация&quot;">​</a></h3><p>Удобное расположение в центре Москвы и парковка на территории бизнес-парка.</p><p><img src="'+o+'" alt=""><img src="'+n+'" alt=""><img src="'+p+'" alt=""><img src="'+c+'" alt=""></p><h2 id="оборудование" tabindex="-1">Оборудование <a class="header-anchor" href="#оборудование" aria-label="Permalink to &quot;Оборудование&quot;">​</a></h2><h4 id="швеиная-мастерская" tabindex="-1">ШВЕЙНАЯ МАСТЕРСКАЯ <a class="header-anchor" href="#швеиная-мастерская" aria-label="Permalink to &quot;ШВЕЙНАЯ МАСТЕРСКАЯ&quot;">​</a></h4><p><strong>Промышленные машины:</strong></p><ul><li>прямострочные Brother S-1000A-5 — 3 шт</li><li>прямострочные Brother S-1000A-3 — 3 шт</li><li>прямострочная с шагающей лапкой Mitsubishi LY2-3300</li><li>плоскошовная (распошивальная) Pegasus W562PV</li><li>оверлок Pegasus M 932-70-5x5</li><li>оверлок Pegasus M 952-16S2-1,5</li><li>петельная Brother HE-800B-2</li><li>имитация ручного стежка Gemsy 8350 А</li><li>подшивочная Typical GL 13101-8</li><li>дисковый раскройный нож 100 мм AURURA YJ-100</li></ul><p><strong>Парогенераторы:</strong></p><ul><li>Hasel Super mini 2Lt</li><li>PRIMULA TV 3811</li><li>термопресс для дублирования VISTA VP-1</li></ul><p><strong>Бытовые машины:</strong></p><ul><li>Brother Style 20 — 7 шт</li><li>оверлоки JUKI B 850 — 2 шт</li></ul><p><strong>Манекены:</strong> Витринные и портновские Royal Dress forms — 8 шт</p><p><strong>Плоттер</strong> формата А0 HP DesignJet T795 для печати лекал</p><h3 id="студия-3d" tabindex="-1">Студия 3D <a class="header-anchor" href="#студия-3d" aria-label="Permalink to &quot;Студия 3D&quot;">​</a></h3><p><strong>Трехмерные принтеры:</strong></p><ul><li>MakerBot Replicator</li><li>Picaso Designer PRO 250</li><li>Prism Pro V2</li><li>FormLabs Form 2</li></ul><p><strong>Трехмерные сканеры:</strong></p><ul><li>Sense</li><li>Range Vision Smart</li></ul><p><strong>Гравировально-фрезерная машина</strong> Roland Modela MDX-40A 3D-сканер и 4D обработка в одном аппарате</p><p>Набор инструментов для обработки моделей</p><p><strong>Программное обеспечение:</strong></p><ul><li>САПР Ассоль /Доступная параметрика,</li><li>Фотодигитайзер,</li><li>Раскладка лекал</li><li>SketchUp</li></ul><p><img src="'+h+'" alt=""><img src="'+u+'" alt=""><img src="'+d+'" alt=""><img src="'+m+'" alt=""></p>',42),P=[_];function k(b,q,f,x,D,S){return a(),l("div",null,P)}const M=i(g,[["render",k]]);export{j as __pageData,M as default};
